import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import TaskPage from "./pages/TaskPage"; // Your Task Manager component
import Login from "./pages/Login";       // Login page component
import Signup from "./pages/Signup";     // Signup page component
import PrivateRoute from "./components/PrivateRoute"; // Protected route

function App() {
  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />

        {/* Protected Task Manager Route */}
        <Route
          path="/"
          element={
            <PrivateRoute>
              <TaskPage />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
